private void skipComments(ParserReader r) throws ParseException, IOException {
	int c = r.read();
	
	if (c == '*') {
		while (c != -1)
			if ((c = r.read()) == '*')
				if ((c = r.read()) == '/')
					return;
	
	} else if (c == '/') {
		while (c != -1) {
			c = r.read();
			if (c == -1 || c == '\n')
				return;
		}
	}
	throw new ParseException(loc(r), "Open ended comment.");
}

